    private Product model = new();
    private DbManager<Brand, int> brandManager = new(ContextGenerator.GetBrandContext());
    private DbManager<Product, string> productManager = new(ContextGenerator.GetProductContext());
    private List<Brand> brands = new();

    protected override async Task OnInitializedAsync()
    {
        brands = await brandManager.ReadAllAsync();
        model.BrandId = brands.Count != 0 ? brands[0].Id : 0;
        await base.OnInitializedAsync();
    }

    private async Task HandleValidSubmit()
    {
        try
        {
            Brand brand = brands.FirstOrDefault(b => b.Id == model.BrandId);
            model.Brand = brand;
            await productManager.CreateAsync(model);

            logger.Log(LogLevel.Information, "Product created successfully!");
            //throw new ArgumentException("Testing custom error handling!");
            navigationManager.NavigateTo("product/index", false);
        }
        catch (Exception ex) // Handle concrete exceptions first!
        {
            errorModel.Code = "DB";
            errorModel.Description = ex.Message;
            logger.Log(LogLevel.Error, ex.Message);
        }
    }


